selector_to_html = {"a[href=\"#taelletrae\"]": "<figure class=\"align-center\" id=\"taelletrae\">\n<a class=\"reference internal image-reference\" href=\"../../../_images/t\u00e6lletr\u00e6.png\"><img alt=\"../../../_images/t\u00e6lletr\u00e6.png\" src=\"../../../_images/t\u00e6lletr\u00e6.png\" style=\"width: 273.0px; height: 263.5px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">figur 13.1 </span><span class=\"caption-text\">T\u00e6lletr\u00e6, der viser mulige m\u00e5der at kombinere to foretter, tre hovedretter og to desserter.</span><a class=\"headerlink\" href=\"#taelletrae\" title=\"Permahenvisning til dette billede\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#opgaver\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">13.3.3. </span>Opgaver<a class=\"headerlink\" href=\"#opgaver\" title=\"Permalink til denne overskrift\">#</a></h2>", "a[href=\"#equation-additionsprincippet\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-additionsprincippet\">\n\\[    n_1 + n_2 + \\cdots + n_k.\\]</div>", "a[href=\"#multiplikationsprincippet\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">13.3.1. </span>Multiplikationsprincippet<a class=\"headerlink\" href=\"#multiplikationsprincippet\" title=\"Permalink til denne overskrift\">#</a></h2><p>Forestil dig, at du er ved at \u00e5bne en restaurant. P\u00e5 dit menukort vil du gerne have fem forretter, seks hovedretter og tre desserter. Hvor mange tre-retters menuer kan du s\u00e5 sammens\u00e6tte? Det er et kombinatorisk sp\u00f8rgsm\u00e5l. Det kan ogs\u00e5 oms\u00e6ttes til et vigtigt sandsynlighedssp\u00f8rgsm\u00e5l. Lad os sige, at du ved, at der er tre af kombinationerne, der tager l\u00e6ngere tid at lave end resten. Hvad er sandsynligheden for, at dine g\u00e6ster v\u00e6lger en af disse kombinationer? Det er potentielt et sp\u00f8rgsm\u00e5l om, hvor stor sandsynlighed er der for, at du vil opleve en meget stresset aften.</p><p>Eksemplet ovenfor leder os til det f\u00f8rste princip, nemlig <em>multiplikationsprincippet</em>. Nogle l\u00e6reb\u00f8ger kalder ogs\u00e5 dette princip for <em>b\u00e5de-og princippet</em>. Grunden til dette er, at multiplikationsprincippet svarer til at kigge p\u00e5 eksperimenter, hvor vi <strong>b\u00e5de</strong> betragter valg 1 <strong>og</strong> valg 2 <strong>og</strong> valg 3 osv. p\u00e5 samme tid. I dette eksempel kigger vi p\u00e5 sammens\u00e6tning af en tre-retters menu, hvor vi for eksempel v\u00e6lger Forret 2 og Hovedret 3 og Dessert 1. Det kunne ogs\u00e5 have v\u00e6ret Forret 1, Hovedret 3 og Dessert 2. Faktisk kan vi skrive 90 tre-retters menuer op. For hver af de fem forretter kan vi v\u00e6lge mellem seks hovedretter, og for hver af de seks hovedretter kan vi v\u00e6lge mellem tre desserter. Det svarer til antallet af tre-retters kombinationer:</p>", "a[href=\"#additionsprincippet-og-multiplikationsprincippet\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">13.3. </span>Additionsprincippet og multiplikationsprincippet<a class=\"headerlink\" href=\"#additionsprincippet-og-multiplikationsprincippet\" title=\"Permalink til denne overskrift\">#</a></h1><p>To grundl\u00e6ggende principper inden for kombinatorikken er additions- og multiplikationsprincippet. I kombinatorikken kigger man p\u00e5, hvor mange m\u00e5der et s\u00e6t af elementer fra forskellige m\u00e6ngder kan s\u00e6ttes sammen. Denne gren af matematikken er vigtig, n\u00e5r vi betragter a priori sandsynligheder.</p>", "a[href=\"#additionsprincippet\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">13.3.2. </span>Additionsprincippet<a class=\"headerlink\" href=\"#additionsprincippet\" title=\"Permalink til denne overskrift\">#</a></h2><p>En anden fundamental vigtig regel inden for kombinatorikken er <em>additionsprincippet</em>. Mods\u00e6tningen til multiplikationsprincippet, som anvendes n\u00e5r flere handlinger skal udf\u00f8res sammen, besk\u00e6ftiger additionsprincippet sig med situationer, hvor valgmulighederne st\u00e5r i <em>enten-eller</em> forhold til hinanden. Derfor kaldes dette princip ogs\u00e5 for enten-eller princippet. Her er valgene gensidigt udelukkende, hvilket betyder, at der kun kan v\u00e6lges \u00e9n mulighed blandt flere forskellige. Princippet anvendes for eksempel til at beregne antallet af mulige udfald, n\u00e5r vi v\u00e6lger \u00e9n mulighed fra en m\u00e6ngde eller fra adskilte m\u00e6ngder.</p><p>For eksempel, hvis du skal beslutte om at v\u00e6lge en forret fra Menu A, som har tre forskellige retter, eller fra Menu B, som har to retter, s\u00e5 vil det samlede antal forskellige forretter, du kan v\u00e6lge mellem, v\u00e6re summen af de to:</p>", "a[href=\"#equation-multiplikationsprincippet\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-multiplikationsprincippet\">\n\\[    n_1 \\cdot n_2 \\cdots n_k.\\]</div>", "a[href=\"#taelletrae2\"]": "<figure class=\"align-center\" id=\"taelletrae2\">\n<a class=\"reference internal image-reference\" href=\"../../../_images/t\u00e6lletr\u00e62.png\"><img alt=\"../../../_images/t\u00e6lletr\u00e62.png\" src=\"../../../_images/t\u00e6lletr\u00e62.png\" style=\"width: 273.0px; height: 193.5px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">figur 13.2 </span><span class=\"caption-text\">T\u00e6lletr\u00e6, der viser mulige m\u00e5der at v\u00e6lge forretter fra enten Menu A eller Menu B.</span><a class=\"headerlink\" href=\"#taelletrae2\" title=\"Permahenvisning til dette billede\">#</a></p>\n</figcaption>\n</figure>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
